          userId: '',
          password: '',        
        }
      }
      onSubmit(e){
          this.setState({
              userId: e.target.userId,
              password: e.target.password
      })
      if( userId == "raman" && password == "123"){
          window.location = '/addDoctor';
      }
    }

    render() {
        return (
            <div>
               <h1> Welcome Admin!!!!!</h1>
              <form onSubmit={this.onSubmit}>
               Admin id
               <input type="text"  />
               Password
